import React from "react";
import "./App.css";
import { BrowserRouter, Route } from "react-router-dom";
import HomePage from "./containers/home/HomePage"
function App() {
  return (
    <BrowserRouter>
        <Route path="/" component={HomePage} />
        <Route path="/about" />
    </BrowserRouter>
  );
}

export default App;
